import React, { useContext } from 'react';
import './css/Shopcatagory.css';
import { ShopContext } from '../contexts/ShopContexts/Shopcontext';

const ShopCatagory = (props) => {
  const { all_product } = useContext(ShopContext);

  return (
    <div className='shopcatagory'>
      <img src={props.banner} alt="" />
      {/* Example usage to prevent 'never used' warning */}
      <div className="product-list">
        {all_product && all_product.map((product, index) => (
          <div key={index} className="product-item">
            <p>{product.name}</p>
            <img src={product.image} alt={product.name} />
          </div>
        ))}
      </div>
    </div>
  );
}

export default ShopCatagory;
